import React from 'react'
import styled from 'styled-components'
import Logo from '../assets/logo-white.svg'



interface Props {
  className?: string 
}

let Header: React.FC<Props> = ( {className }) => {
  return (
    <header className={className}>
      <Logo/>       
    </header>
  )
}


Header = styled(Header)`

`
export default Header
